import axios from "axios";
import endpoints from './endpoints'

export const fbAuthentication = async (token, id) => {
    const url = endpoints.FB_AUTH
    const params = {
        token,
        id
    }

    const res = await axios.get(url, {
        params
    })

    return res.data

}

export const  searchInterest = async (token, keyword, limit) => {
    const url = endpoints.FB_INTEREST_SEARCH(2.11)
    const params = {
        q: keyword,
        type: 'adinterest',
        access_token: token,
        limit
    }
    const res = await axios.get(url, {
        params
    })
    return res.data
}



export const getProducts = async (shopName) => {
    const url = endpoints.GET_PRODUCTS(shopName)
    const params = {
        limit: 10
    }
   const res = await axios.get(url, {
        params
    })

    console.log(res.data)
}
